Existe una pasión constante por grabar y producir materiales audiovisuales en Hoteles que encierran una energía cuántica de la época dorada del puerto de Acapulco. Autos, accesorios, letreros, murales, son algunos de los elementos que despiertan interés y admiración durante nuestros scoutings. En el año de 1940, uno de los hoteles más populares del Acapulco tradicional, fue sin duda el hotel Vilia, ubicado muy cerca de Caleta y Caletilla. Sus rincones encierran mucha nostalgia del Acapulco del ayer.

